    public function run(): void
    {
        $noResult = [];
        foreach (self::SIMANTAP_USER as $key => $user) {

            $sekolah = Sekolah::where('npsn', $user['npsn'])->first();
            if ($sekolah) {
                $model = PasswordSekolah::where('sekolah_id', $sekolah->id)->where('client_name', $user['client'])->first();
